import { useState } from 'react'
import { v4 } from 'uuid' //Universally Unique Identifier
import { useNavigate } from 'react-router-dom'
import Heading from './Heading'
import MyNav from './NavBar'
import resultSet from '../data/cars.json'

const CreateCRUD = () => {
	const errMes = {
		color: 'red',
		fontSize: '11',
		fontStyle: 'italic',
	};
	const navigate = useNavigate() //Declare for page redirect

	/* 1. Data member */
	const [brand, setBrand] = useState('')
	const [model, setModel] = useState('')
	const [price, setPrice] = useState('')

	const [errBrand, setErrBrand] = useState('')
	const [errModel, setErrModel] = useState('')
	const [errPrice, setErrPrice] = useState('')

	/* 2. Form submit */
	const handleSubmit = (e) => {
		e.preventDefault() // Cancel the event as cancelable

		// 2.1. Get value for Item
		const key = v4() // Creating unique id using version 4 from UUID
		const newBrand = brand, newModel = model, newPrice = price

		// 2.2. Check validation
		if (!newBrand) {
			setErrBrand("Brand is invalid!")
			document.getElementById('txtBrand').focus()
			return
		}else{
			setErrBrand("")
		}
		if (!newModel) {
			setErrModel("Model is invalid!")
			document.getElementById('txtModel').focus()
			return
		}else{
			setErrModel("")
		}
		if ((!newPrice) || (newPrice <= 0)) {
			setErrPrice("Price is invalid!")
			document.getElementById('txtPrice').focus()
			return
		}else{
			setErrPrice("")
		}

		// 2.3. Add new item to list
		resultSet.push({
			id: key,
			brand: newBrand,
			model: newModel,
			price: newPrice
		})

		// 2.4. Redirect to Home page
		navigate('/')
	}

	return (
		<>
			<div className='location-1-1'>
				<Heading />
			</div>
			<div className='location-1-2'></div>
			<div className='location-2-1'>
				<MyNav />
			</div>
			<div className='location-2-2'>
				<form onSubmit={(e) => handleSubmit(e)} >
					<table>
						<tr>
							<td align="right">Brand:</td>
							<td>
								<input id="txtBrand" onChange={e => setBrand(e.target.value)} placeholder="Enter Brand" />
								<div style={errMes}>{errBrand}</div>
							</td>
						</tr>
						<tr>
							<td align="right">Model:</td>
							<td>
								<input id="txtModel" onChange={e => setModel(e.target.value)} placeholder="Enter Model" />
								<div style={errMes}>{errModel}</div>
							</td>
						</tr>
						<tr>
							<td align="right">Price:</td>
							<td>
								<input id="txtPrice" onChange={e => setPrice(e.target.value)} placeholder="Enter Price" />
								<div style={errMes}>{errPrice}</div>
							</td>
						</tr>
						<tr>
							<td></td>
							<td>
								<button className='btn btn-outline-primary'>
									Save to List
								</button>
							</td>
						</tr>
					</table>
				</form>
			</div>
		</>
	)
}

export default CreateCRUD
